import React from 'react';
import styled from 'styled-components';

const ListWrapper = styled.div`
  width:100%;

`;

const ListItemWrapper = styled.div`
  width:100%;
  display:flex;
  flex-flow: row wrap;
`;

interface CommunityItemIF {
  id: number;
  title: string;
}

const dummy = [
  { id:1,title: '테스트' },
  { id:2,title: '테스트' }
]

const CommunityList = () => {
  return (
    <ListWrapper>
      {dummy.map((item:CommunityItemIF) => ( 
        <ListItem key={item.id} item={item}/> 
      ))}
    </ListWrapper>
  ) 
}


const ListItem = ({ item }:CommunityItemIF) => { 
  return (
    <ListItemWrapper>
      {item.title}
    </ListItemWrapper>
  )
}


export default CommunityList;
